#include<iostream>#include<vector>#include<algorithm>using namespace std;void DFS(int i, int depth);bool check[9] = { false, };bool ox = false;int loser[9];int main(void){		for (int i = 0; i < 9; i++)		cin>>loser[i];	sort(loser, loser+9);	DFS(0, 0);}void DFS(int index, int depth){		if (depth == 7)	{		int sum = 0;		for (int i = 0; i < 9; i++)			if (check[i])				sum += loser[i];		if (sum == 100)		{			for (int i = 0; i < 9; i++)				if (check[i])					cout << loser[i] << endl;			ox = true;		}	}	for (int i = index; i < 9; i++)	{		check[i] = true;		DFS(i + 1, depth + 1);		check[i] = false;		if (ox)			return;	}}